function Resume() {
    return (
        <div style={resumeCSS}>
            <div style={sectionCSS}>
                <div style={sectionHeaderCSS}>
                    <div style={sectionHeaderTextCSS}>
                        Education
                    </div>
                </div>

            </div>
        </div>
    )
}

const resumeCSS = {
    background: "#fff",
    paddingTop: "90px",
    paddingBottom: "72px",
    overflow: "hidden"
}

const sectionCSS = {
    marginBottom: "48px",
    paddingBottom: "24px",
    borderBottom: "1px solid #E8E8E8",
    width: "96%",
    maxWidth: "1020px",
    margin: "0 auto"
}

const sectionHeaderCSS = {
    paddingTop: "9px",
    width: "25%",
    position: "relative",
    padding: "0 20px",
    minHeight: "1px",
    float: "left"
}

const sectionHeaderTextCSS = {
    font: "18px/24px opensans-bold, sans-serif",
    textTransform: "uppercase",
    letterSpacing: "1px",
    borderBottom: "3px solid #11ABB0",
    paddingBottom: "6px"
}

const sectionContentCSS = {
    paddingRight: "10%",
    float: "right",
    width: "75%"
}

export default Resume;
